import React from 'react';
import { Link } from 'react-router-dom';
import './Cards.css';
import './ProfileImage.css';

function ProfileImage() {
  return (
    <>
      <li className='profile__item__img'>
          <Link className='profile__item__link' to='/'>
            <figure className='profile__item__pic-wrap' data-category="hiking">
              <img
                className='profile__item__img'
                alt='Andrew Image'
                src="images/andrew.JPG"
              />
            </figure>
            <div className='profile__item__info'>
              <h5 className='profile__item__text'>Dolomites Trip, June 2022</h5>
            </div>
          </Link>
        </li>
    </>
  );
}

export default ProfileImage;
